import { createTheme } from '@mui/material/styles';

const appTheme = createTheme({  // Renamed to appTheme to avoid conflicts
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

export default appTheme;  // Export as appTheme
